export const Headerbox=styled.div`
    position:fixed;
    top:0;
    z-index:2;
    height:56px;
    width:100%;
    box-shadow:0px 0px 8px #333333;
    line-height:56px;
    text-align:center;
    &.HeaderSearch{
        width:100px;
        height:30px;
        margin:13px;
    }
`
